INSERT INTO `recommendar_review` VALUES (121,'The restaurant used to be a good place to dine with good food quality and service but with the passage of time has lost the touch. The last visit was  a total disaster. Order served was completely haphazard. The pizza was served first and the appetizer followed, that too upon reminding the staff twice. Again the staff along with the shift supervisor were not at all pushed regarding their lapse. To add to the misery, drinks were served once more than half the meal was over. Definitely not going to re visit the place. Authorities may look into the deteriorating services at the restaurant.','NEG','2025-01-10 10:32:22.618328',1,0,NULL,0.8761599999999999,0.48,0.09199999999999997),(122,'The restaurant is good, excellent service. Food waz really good, thick crust with cheese filled is really amazing its the best filled crust Among all the other local pizza restaurants but most of the time they have difficulty in their \"west side garlic chicken\" flavour because Everytime you order that flavour its gonna be little different so i myself come to a conclusion that they dont follow a proper standard on that flavour, but the customer service is satisfying and i am a regular customer to Broadway. Lastly the lighting condition or the choosen lighting style is not very good','POS','2025-01-10 10:33:41.727975',1,0,NULL,0.9154599999999999,0.92,0.9287599999999999),(123,'Sorry, but I was totally disappointed with the quality of products at Broadway Pizza. Pizza had scarcely any toppings on it, was very dry to eat, and was tasteless. It was like eating a thick dry bun. Both the sandwiches were even more disappointing. First of all, both didnt pass the definition of a proper sandwich. There was lots of spread on the buns with mostly just shredded veges and hardly any meat chunks, again totally tasteless.  I certainly wont recommend Broadway Pizza to anyone unless and until I dare to order again and see any improvements.','NEG','2025-01-10 10:34:48.033957',1,0,NULL,0.22922999999999996,0.11,0),(124,'I am writing to express my dissatisfaction with the service at your Bahadrabad branch. During my visit, there was no server in the dining area, and despite calling the counter for assistance, we were left waiting without any support. Additionally, the branch manager, who was outside the branch and not wearing a name tag, did not address the issue.Due to this disappointing experience, I regret to inform you that I will not be visiting Broadway Pizza in the future. I hope you will address these issues to improve your service for others.Sincerely,','NEG','2025-01-10 10:36:20.873401',1,0,NULL,0,0,0),(125,'Took WAY too long for the pizzas to arrive, and all of the pizzas were cold, matlab pizza ready kar k bhool gaye kya? We were the only ones there so its not like bahot customers wait kar rahe hain, Staff was barely paying attention to work, too many mosquitos and half the lights were off. I was genuinely shocked on how service could be this bad in a fairly famous chain. Please apni branch ko improve kar ne pe focus karen because the taste was decent even tho the pizza was cold','NEG','2025-01-10 10:37:01.307490',1,0,NULL,0,0,0),(126,'Ambiance: 5/5   Modern, trendy vibe with comfortable seating and lively atmosphere. Perfect for hangouts, dates, or family gatherings! Service: 5/5   Friendly, attentive staff who go above and beyond to ensure an exceptional dining experience!Food: 5/5   Authentic, mouth watering pizzas that will transport your taste buds to Italy! Crust is crispy, sauce is rich, and cheese is melted to perfection. Try their signature \"Broadway Special\"   its a flavor explosion!','POS','2025-01-10 10:38:00.906714',1,0.78591,NULL,0.78,0.78,0.78),(127,'The deals are pretty good. Taste is amazing. Stuffed crust changed my thoughts about the crust, now I love eating the sides too. Service is also pretty good. Ask for free wifi. Dont forget to sprinkle a little garlic powder and chilli if you like, it greatly enhaces the taste. Dip sauces tastes better than ketchup. Dine in area is relatively small as compared to other outlets. Best part is that they will ask about your review at the end.','POS','2025-01-10 10:39:04.544078',1,0,NULL,0.5836633333333333,0.49,0.8902),(128,'Worst experience ever... yesterday I ordered 4 20inch pizza deal, in Ads, they commit delivery in 1 hour but didnt get my order in time, after complaining 3 times, the rider came after 1.75 hours with cold pizza... I called directly to the branch and instead of any excuse or compliment the operator replied with an unethical attitude like \"sorry hogaye der, ub to agaya na, kia karskty hen\". #worstService #worstAttitude #noCustomerRespect','NEG','2025-01-10 10:40:28.935603',1,0,NULL,0,0,0),(129,'In conclusion, my experience at Broadway Pizza was a mix of positives and areas that could be improved. While the ambiance and customization options were notable, the inconsistencies in taste, crust, and temperature left me feeling less satisfied than I had hoped. With a bit more attention to these aspects, Broadway Pizza has the potential to provide a more consistent and enjoyable dining experience for its customers.','Neutral','2025-01-10 10:41:14.643541',1,0,NULL,0,0,0),(130,'Today I visit broadway pizza the food is best.There is free WiFi available here Broadway has one of the pizza chain in Pakistan so I order 2 large pizzas its topping was to much cheese and chicken and taste is awesome first flavor habanero spicy and second creamy flavor Arabic its loaded to much chicken I highly recommended to must try and specially thank Mr Noman Manager for a good suggestion','POS','2025-01-10 10:41:29.354145',1,0,NULL,0,0.9,0.9042399999999999),(131,'3rd class service, I bought 20\" inch pizza deal, and in appettizer I bought Potato wages, looked like that they were prepared three days ago, and pizza was also not well done, had a very bad experience on broadway, and there are so many other options available other than broadway which provide better food quality and better service. Very disappointed','POS','2025-01-10 10:42:18.873924',1,0,NULL,0.8427199999999999,0.57,0.8761599999999999),(132,'I recently had the pleasure of trying Broadway Pizza in Bahadurabad and I have to say, it was fantastic! The pizza was delicious, with perfectly cooked crust and flavorful toppings. The service was also top notch   the staff was friendly and attentive. Overall, it was a great experience and I would highly recommend giving Broadway Pizza a try.','POS','2025-01-10 10:43:01.748954',1,0,NULL,0.9224133333333333,0.89,0.85868),(133,'The menu offered a good variety of options, and the ability to customize my pizza was appreciated. The toppings were fresh, and the presentation of the pizza was visually appealing. However, I found the crust to be slightly uneven in terms of thickness, which affected the overall texture of the pizza.','POS','2025-01-10 10:43:49.628890',1,0,NULL,0.5668233333333333,0.72,0.8761599999999999),(134,'I would have given them five stars but since they have changed the cheese in their stuffed crust the quality is going down. The new stuff is really gooey non cheese like and it tastes even more terrible when cold. The toppings are filling but please do something about the stuffed crust cheese!','NEG','2025-01-10 10:44:09.428335',1,0,NULL,0,0,0),(135,'Broadway Pizzas new Butter Chicken flavor is a taste sensation! The fusion of butter chicken sauce and pizza crust is brilliant. Crispy crust, generous chicken, and perfect spice balance make it a must try. Exceptional service and a delightful dining experience overall. Highly recommended!','POS','2025-01-10 10:44:50.337885',1,0,NULL,0.871,0.83,0.78),(136,'A nice and quiet place in the afternoon to have lunch if youre craving pizza and visiting Bahadurabad and karachi. Broadway is my first choice to do. This branch is nice and staff is really cool. They should get a raise. Plus alot cards are offering discount so what else you need.','POS','2025-01-10 10:45:24.175610',1,0.8685999999999999,NULL,0.78,0.78,0.6819366666666665),(137,'We order from bahadarabad branch 2 large pizzas . A rider came to deliver with glasses on given time and was kind and polite . Coming to food pizzas were hot and fresh and taste was awesome. It was my first experience and excellent and suggesting to others. Must try Broadway pizza.','POS','2025-01-10 10:45:55.673136',1,0,NULL,0.7149899999999999,0.71,0),(138,'Its great experience the ambiance is very welcome and charming amazing  food and service staff are extremely knowledgeable and make great recommendations and thank u for noman manager was good suggestion flavor wicked & Arabic was awesome  great good job keep it up','Neutral','2025-01-10 10:46:04.019778',1,0,NULL,0,0,0),(139,'The pizza crust was hard, the stuffing was sour, the sauce on top of the pizza was sour, the sauces they give along with the pizza was sour too, even some meat was sour! The soft drink they gave us tasted like Jet Sports (popsicle). In short dont go to this branch','NEG','2025-01-10 10:46:41.127939',1,0,NULL,0,0,0),(140,'Yesterday I visited at Broadway bhadrabad branch its a surprising for me what a wonderful taste it was very good environment neat and clean place fantastic service i had listened about Broadway but it a very good experience for me its my first ever visit there.','POS','2025-01-10 10:46:49.688572',1,0.8761599999999999,NULL,0,0.88,0),(141,'I tried the small pizza and garlic bread both of which were really fresh. The good part of this franchise is that it is open 24/7. And i got to have the pipinv hot pizza early in the morning at 7am. And the cheesy garlic breD which ranch sauce was fire.','Neutral','2025-01-10 10:47:18.573089',1,0,NULL,0,0,0),(142,'Today i visit with my family braodway pizza bahadurabad branch we have order 2 LARGE pizza arabic and mamaia chk beef its very good toppings and excellent service and specially thanks branch Manager Noman nys person we will visit again soon inshAllah...','POS','2025-01-10 10:47:57.597283',1,0,NULL,0.78,0.78,0),(143,'Amazing Staff. Our waiter \"Samee\" , a happy and helpful boy helped us with recommendations in choosing what we wanted to eat. Pizzas were properly cooked. We ordered a Kebab Calzone on his recommendation which was amazing. Kebab Calzone is must try!','POS','2025-01-10 10:48:56.506584',1,0,NULL,0.90584,0.92,0.93436),(144,'taste always good. they offer an awesome range of pizzas deals, I liked dining here. Staff members are friendly, I have visited this place numerous times with family & friends.. wide range of varieties available. ! my favorite arabic ranch & euro...','POS','2025-01-10 10:50:07.099202',1,0.8685999999999999,NULL,0.87984,0.88,0.8975599999999999),(145,'We tried the Habenaro Pizza which is a premium flavour. It was spicy and pretty nice. Moreover, the presentation was simply superb. Really liked the idea of keeping the crushed chillies, garlic powder and ketchup on every table in a hygienic way.','POS','2025-01-10 10:50:49.114131',1,0,NULL,0.78,0.78,0),(146,'However, this particular outlet has 2 issues.... Cleanliness is not top notch, rather its a dingy place and with not so much lighting it doesnt feel well. Second, parking space is not sufficient so youll be lucky to find a parking spot nearby.','NEG','2025-01-10 10:51:48.690246',1,0,NULL,0,0,0),(147,'Today dinning with Broadway pizza bahadurabad love there Arabic and phatom pizza the have amazing food and the quantity is also great .Taste is very unique and delicious!!good service kamran thanks and Arham manager best of luck Broadway pizza','POS','2025-01-10 10:52:06.376295',1,0,NULL,0.94456,0.94,0),(148,'While the taste was generally satisfactory, I expected a more robust flavor profile. The cheese lacked a certain richness, and the sauce was somewhat lacking in depth. Additionally, the pizza arrived lukewarm, which was a bit disappointing.','NEG','2025-01-10 10:52:57.539625',1,0,NULL,0.4818133333333333,0.24,0),(149,'The staff said as directed by Broadway officials you can only take both stuff or thin crust. You cant take one stuff or one thin on BOGO. This is the only thing which disappointed. Rest all are good. Staff is humble and friendly.','Neutral','2025-01-10 10:53:32.122779',1,0,NULL,0,0,0),(150,'Ordered this Giant Pizza filled with cheese and duo in flavors really cooked well located in bahadurabad couple of times i visited in lahore too near hussain chowk theri buffalo sauce and other sauces adds value in broadway','Neutral','2025-01-10 10:53:41.189923',1,0,NULL,0,0,0),(151,'Service was efficient, with my order arriving promptly. However, I encountered a minor hiccup when a wrong topping was included on my pizza. The staff promptly rectified the mistake, but it did disrupt the flow of the meal.','POS','2025-01-10 10:54:19.976433',1,0,NULL,0,0.87,0.8685999999999999),(152,'One place i like to enjoy pizza from. Their pizza quaility is way better than others. It is a must try. Broadway pizza is offering both broad and thin crust for its lovers. Their prices are above avg and serice is fine.','POS','2025-01-10 10:54:53.861528',1,0,NULL,0.7118599999999999,0.71,0),(153,'The food is best. There is free WIFI available here. Broadway has one of the best Pizzas in the city. And they are reasonably priced. They serve fresh, normally serving time is not long. Staff is polite and respectful.','POS','2025-01-10 10:55:43.060452',1,0,NULL,0.95476,0.91,0.85592),(154,'On the positive side, the ambiance was inviting, creating a comfortable atmosphere for dining. The open kitchen concept was interesting to watch, and the staffs friendly demeanor added a warm touch to the experience.','POS','2025-01-10 10:56:17.352425',1,0.5771966666666667,NULL,0,0.73,0.8791599999999999),(155,'Today I with my family at Broadway pizza bahaduabad I try there new flavors king pizza its tummy cheesey and good topping must try and very fast service manager noman was nys person for a good suggestion thanks','Neutral','2025-01-10 10:56:26.222060',1,0,NULL,0,0,0),(156,'Broadway Pizza Bahadurabad hands down some of the best pizzas around. Really fresh and well made. Never over or undercooked. They have somehow managed to make it the perfect medium. I highly recommend them here!','POS','2025-01-10 10:56:57.886370',1,0,NULL,0.95476,0.94,0.9287599999999999),(157,'Good food enjoy meal thanks noman manager for good suggestions wether on pizza or pasta its honestly delicious portions are huge and the staff is extremely friendly and courteous thanks  good job keep it up','POS','2025-01-10 10:57:07.097106',1,0,NULL,0.8904266666666666,0.89,0),(158,'I was so impressed with my breakfast this morning! Always delicious Broadway new flavour butter chicken  good suggestion amir server and coprative staff and Mr Noman Manager very nice  person good dealing','POS','2025-01-10 10:57:15.592483',1,0,NULL,0.9287599999999999,0.93,0),(159,'Broadway Pizza Bahadurabad What a spectacular display of Arabian Ranch Pizza in its prime. Perfectly executed slices with the finest ingredients make this popular pizza destination a must stop.','POS','2025-01-10 10:57:29.225213',1,0,NULL,0.8673799999999999,0.87,0),(160,'A couple of good things to start with, the serving size is ample (I mean it) then the environment is pretty much okay. But I kept searching for cheese in my pizza, and hardly found it in there.','NEU','2025-01-10 10:57:55.187100',1,0.44051999999999997,NULL,0,0.44,0),(161,'I didnt really like my experience with this branch. I love Godspell Beef load but this one was pretty disappointing. Maybe because its a discounted deal. But still, other branch serve better.','NEU','2025-01-10 10:58:28.537914',1,0,NULL,0.3786,0.41,0.44839999999999997),(162,'Nice. But this visit, ac was not working. After 10 mins lights shuts down. Generator were started but it was humid and suffocating. Still good because food was tasty and staff was cooperative.','POS','2025-01-10 10:59:07.384087',1,0,NULL,0,0.78,0.78),(163,'Worst experience ever on Broadway, AC was not running fine, If I wasnt that hungry I would never eat at such a mess place. I have been to other branches and they are pretty well maintained.','NEG','2025-01-10 10:59:35.182041',1,0,NULL,0,0,0),(164,'The pizza at Broadway Pizza Bahadurabad is truly amazing and you will definitely recommend trying these guys. They have a great selection of toppings and great prices on a forty inch slice.','NEU','2025-01-10 10:59:50.681094',1,0,NULL,0.49448000000000003,0.72,0.9499599999999999),(165,'I recently dined at Broadway Pizza and found the experience to be a mixed bag. While there were certainly some positive aspects, there were also a few areas that left room for improvement.','POS','2025-01-10 11:00:13.198110',1,0.92296,NULL,0,0.92,0),(166,'Visited Broadway Clifton for my Birthday ... Had an incredible dinner there. Tried Wicked Blend, Dancing Fajita and Wings, all of them were perfect. I highly recommend. Great service too','POS','2025-01-10 11:01:06.386770',1,0,NULL,0.78,0.86,0.9499599999999999),(167,'Broadway Pizza Bahadurabad offers a great range of fresh pizzas. I loved eating here. The staff members are always friendly, the prices are reasonable and the place is always kept clean','POS','2025-01-10 11:01:34.504061',1,0.82038,NULL,0.9448599999999999,0.89,0.8975599999999999),(168,'Probably the worst pizza in Karachi. Absolutely rubbish. Got 2 pizzas both with no toppings. Delivered late as well. Not worth your money. California pizza far better in every aspect.','NEG','2025-01-10 11:02:14.035878',1,0,NULL,0.3131,0.38,0.44051999999999997),(169,'The food was good overall,but the service was very poor,like they were not giving plates as much as the people on our table and also the table was so small that we could hardly settle','NEG','2025-01-10 11:02:33.938981',1,0,NULL,0.8761599999999999,0.29,0),(170,'Always love the taste and love the ambience, staff is cooperative. I always dine in with my friends and family. They offer wide variety of pizza range. Highly recommend to everyone!','POS','2025-01-10 11:03:09.480267',1,0.95476,NULL,0,0.95,0),(171,'Loved experience recently their new launch pizza butter chicken its very tasty tummy i recommend to you must try this flavor thanks Mr M.Noman Manager for a good suggestion.....','POS','2025-01-10 11:03:46.048578',1,0,NULL,0.78,0.83,0.8761599999999999),(172,'Had a great experience at Broadway Pizza as customer service was phenomenal with great assistance with the menu. Food came on time and was fresh. The food itself was delicious.','POS','2025-01-10 11:04:06.638869',1,0,NULL,0.9287599999999999,0.93,0),(173,'10 out of 10. Will go again and again. Tried tuesday deal there as well as buy one get one free. Just Amazing, recommended for pizza lovers. Specially, arabic ranch and fajita.','NEU','2025-01-10 11:04:51.531923',1,0,NULL,0.43091999999999997,0.43,0),(174,'Broadway Pizza Bahadurabad is a game changer in Karachis food scene! Dont miss out on this culinary delight. Visit now and indulge in the best pizza experience in town!','POS','2025-01-10 11:05:05.988095',1,0,NULL,0.95476,0.95,0),(175,'Its so sad to see Pakistani Brand not keeping Pakistani beverages and the excuse was company had a deal with pepsi. So shameful to see such brands just going behind money','NEU','2025-01-10 11:05:19.830338',1,0,NULL,0,0.15,0.15243999999999996),(176,'Clean environment and staff behavior nice manager noman for cooperative and good suggestion everything was outstanding service was delighful and very professional .......','POS','2025-01-10 11:06:00.778292',1,0,NULL,0,0.87,0.8685999999999999),(177,'The crust is so large, thick and chewy. Cant even taste the pizza properly. It feels like Im only eating dry crust. The quality has dropped as compared to before.','NEG','2025-01-10 11:06:31.660991',1,0,NULL,0,0,0),(178,'I ordered Tarzan Tikka but I got other flavor and I also paid extra money for stuff crust but I dont got that and the pizza was also cold , extremely disappointed','Neutral','2025-01-10 11:06:45.310220',1,0,NULL,0,0,0),(179,'Thats when I had the best pizza of my life. Since then I have visited Broadway Pizza Bahadurabad many times and my opinion about this pizza has not changed.','POS','2025-01-10 11:06:58.898938',1,0,NULL,0.95476,0.95,0),(180,'Visited Bahadurabad Br. Taste of pizza was average. Dinning space was cramped with setties with in efficient air conditioning. Overall pathetic experience.','POS','2025-01-10 11:07:25.473854',1,0.8685999999999999,NULL,0,0.87,0),(181,'Today I visit Broadway pizza bhd and meet Mr Noman manager he was good man good suggestion king crust pizza was a very nice toop and good taste pizza.....','Neutral','2025-01-10 11:07:56.455318',1,0,NULL,0,0,0),(182,'We have the best pizza ever in Karachi!! The pizza was so delicious and with so much flavor that we went to Broadway Pizza Bahadurabad twice in one day!','POS','2025-01-10 11:08:05.773975',1,0,NULL,0.95476,0.95,0),(183,'We have the best pizza ever in Karachi!! The pizza was so delicious and with so much flavor that we went to Broadway Pizza Bahadurabad twice in one day!','POS','2025-01-10 11:08:13.913912',1,0,NULL,0.95476,0.95,0),(184,'Broadway Pizza Bahadurabad makes you feel like family. Dont be afraid to order something other than pizza because whatever you order will be the same.','Neutral','2025-01-10 11:08:27.504999',1,0,NULL,0,0,0),(185,'Fresh, high quality ingredients used in every pizza, Wide variety of toppings to suit every taste, Prompt delivery and takeaway services available','POS','2025-01-10 11:08:52.812646',1,0.78,NULL,0.78,0.78,0.78),(186,'Taste is always good but mostly they will forget your specific instructions. So Make sure to check your order before you start enjoying your meal.','POS','2025-01-10 11:09:06.685695',1,0,NULL,0.89342,0.89,0),(187,'If you really willing to eat a geniune and authentic pizza. Stop thinking more and come here to enjoy the best pizza in Karachi. Really love it.','POS','2025-01-1