b one floor through stairs, no elevator or wheelchair ramp is available. So if you are someone who dont like stairs or use this is not the place for you. The entrance is on the right of burger lab which is located on the ground floor of the same building.','POS','2025-01-10 16:01:23.009094',11,0,NULL,0,0.42,0.84442),(860,'Broadway Pizza offers delicious, high quality pizzas with a wide range of toppings to suit every taste. The crust is perfectly crisp, and the toppings are always fresh. The casual, welcoming atmosphere and friendly service make it a great spot for both families and friends. Prices are reasonable, and the portion sizes are generous. Overall, Broadway Pizza is a fantastic choice for a satisfying and enjoyable meal. Highly recommended!','POS','2025-01-10 16:02:19.157922',11,0,NULL,0.8501285714285713,0.87,0.88686),(861,'I tried Pizza of different brands. The only one that I want to declare as Pizza is California Pizza. Besides that it is better to not waste your money on brand. You can buy the same quality Pizza from local Pizza sellers. I bought large Pizza in 1700 Rs. You can buy same Quality Pizza with the difference of 19, 20 in  just 600 or 1000 rs. Although there area was clean and servong was good. One 13 inch Pizza was enough for two guys.','POS','2025-01-10 16:03:05.053512',11,0,NULL,0.6725,0.77,0.8761599999999999),(862,'It was a absolutely brilliant experience for us to celebrate our daughters 2nd birthday at Broadway Pizza aisha manzil branch, John with his services and Tahir with his team the management was absolutely upto the mark, the decorations the food everything was on spot, we highly recommend and assure you they will provide you the best service, looking ahead further celebrating birthday of our son as well InshaaAllah','POS','2025-01-10 16:03:30.485922',11,0,NULL,0,0.95,0.95476),(863,'I recently ordered a thin crust 13\" pizza online for home delivery from Broadway pizza (FB Area branch) I was totally disappointed with their qualit