 hesitate to ask them about their stock situation first','POS','2025-01-10 17:06:28.755395',13,0.24072,NULL,0.35024,0.3,0),(1057,'Went for lunch, firstly the glass door was locked from both ends ask staff to give some space elsewhere they said have only that floor for walk in customers which is fine after opening went in and sit on a table a guy from staff came in and asked with whom are u with as we are 2 people i asked him what he is asking about he said that this table is reserved just because they are more in numbers and we are waiting for equal amount of time and arrogant ask us to leave the table to my question is that if we are going to your restaurant so can be accommodated in terms of numbers and how does a table is reserved if a party is enter with us and asking same question and plus where is the customer care in your branch','Neutral','2025-01-10 17:06:39.757117',13,0,NULL,0,0,0),(1058,'Promotional butter chicken pizza, priced almost 1/4th more than a normal large has the best crust ive ever had not because of its own quality but the supreme abomination that was on the loaf of bread in front of the crust. An 80  rupees pizza from your local  bakery would provide you with a better experience, how this thing was conceived is beyond me, I believe there are no other negative reviews of this specific pizza because no one else lived long enough to write a review. Give me my 1800 rupees back. I wish I could cut open my stomach to take it out, the fact that its going to pass through my anus makes me feel molested. DO NOT TRY BUTTER CHICKEN FOR THE LOVE OF ALLAH','POS','2025-01-10 17:07:28.315590',13,0,NULL,0.6151899999999999,0.62,0),(1059,'Yeah..... The food was ....just okay! Not something to be very excited or discuss about.... Im guessing that their main course has shifted from pizza to pasta or something else maybe....but not pizza.... definitely!!! Yes...there were times when Broadway pizza was serving good quality and tasty pizza.....but Im afraid they are no more.... Besides....the seating arrangement was fine....not many changes over the years essentially.... Well behaved and well trained servers ...in fact Ive noticed a couple of servers still working here.... Overall it was a fair experience. Possibilities of improvement are there and quality of the food needs to be upgraded.','POS','2025-01-10 17:12:12.102994',13,0.78092,NULL,0.6854833333333332,0.76,0.80928),(1060,'There is nothing wrong with there pizza always good. But customer service the pathetic. Yesterday I ordered on call center for take away on 3pm he told me to collect from desired branch in 15 to 20 min when I reached there after 30 minutes there were no order placed . I called call center a lady asked me details and said plz hold I will check after 3 mins hold she disconnected the call. I called again another guy received the call he said there is no order placed by me. And disconnected the call. The person at branch asked me sir you can place order now directly , we will serve you in 15 minutes and he did. They should improve their customer care.','POS','2025-01-10 17:12:58.562161',13,0,NULL,0.8761599999999999,0.53,0.19215999999999994),(1061,'This branch always send incorrect notifications that my order is dispatched, manager always lie that it maybe because our system has some technical issues which is why you got wrong notifications even after 4 months theyre still lying in the same old way, so I stopped ordering from them and today I ordered only two lava cakes thought they will deliver on time and its been an hour I still havent received it and after talking to their manager Alyan hes still using old stuff oh theres some technical problem etc!!!','NEU','2025-01-10 17:13:14.019122',13,0,NULL,0,0.35,0.35),(1062,'Yesterday 15 may 21 I made an online order , order # 1047148 it was placed at 09:04 pm and expected delivery was in 60 mins ,I have been calling for one hour to know the status of order 1047148.  This was placed at 09:04 and expected to deliver in 60 minutes. But no one gave proper response even the contact # shared by helpline of concerned branch never picked up the phone and they never respond to my so many calls. I recieved the order almost 11:15 pm which is approx 75 mins delay from expected delivery.','NEU','2025-01-10 17:13:45.744618',13,0,NULL,0,0.49,0.49335666666666667),(1063,'The service is outclass. But the food is complete dry and not warm enough to eat. There only one or two pizzas are best. Other are so dry or tasteless. But there sweet dishes are so great. There service should have to be improved cause they serve very slow. Waiter dont listen that much even rarely help out. The lightning of restraunt is very dim. Even the wall Art and environment is great but Light matters alot. And very poor cleanliness,ike there is dust on table. The sofas are in very poor condition.','POS','2025-01-10 17:14:49.927611',13,0.37964,NULL,0.95236,0.44,0),(1064,'Ordered large Chicken Tikka Pizza last night, was stale and been sitting for a while. I could tell because it smelled bad and the toppings looked stale. You shouldnt be charging a 1000 RS for a rotten pizza with only a handful of uncooked potato wedges for 400 RS. Its our hard earned money too. Just because we order does not mean we have a dollar tree in our backyard. The health hazard rotten food poses should be given a consideration before delivering it to customers. Very disappointing.','NEG','2025-01-10 17:15:34.221358',13,0,NULL,0,0,0),(1065,'This is the last time I visited Broadway Gulshan branch. Wont be going there anymore. Broadway pizza taste has gone from best to worst. The crust was literally 1 inch thick and half baked raw, upon asking them to change the pizza, they admitted their mistake and replaced it but again with a similar crust of 1 inch raw dough. Got it packed and got home. Had vomits at night even though I just had half a slice. Whole two pizzas ware wasted.','Neutral','2025-01-10 17:16:20.656373',13,0,NULL,0,0,0),(1066,'Their