e confined dining area was too noisy. Our first order was quickly delivered and I realized that it was not enough for all so immediately I ordered another one, which took ages to deliver.','POS','2025-01-10 17:19:14.207489',13,0.40249999999999997,NULL,0,0.4,0),(1071,'Good place, good people and good food.... Im giving 4 instead of 5 stars because the dinning area at ground floor was a bit small and it was feeling crowded almost all of the time. First floor was probably engaged in some sort of activities or so, thats why we have to manage it on ground floor. The environment was overall Good and Deals are also Amazing.','POS','2025-01-10 17:20:00.278199',13,0.8955599999999999,NULL,0.8761599999999999,0.89,0),(1072,'Flavors are good, service is also good as ketchup, garlic powder n crushed chillies were there on the table which is a good addition! But atmosphere is very very very noisy. Had the most tiring eating experience last night because all the kids were crying out like anything! Spoiled my pizza: and on top of it music was also annoyed us because of the fuss','POS','2025-01-10 17:20:21.744131',13,0.40249999999999997,NULL,0.8761599999999999,0.72,0.8761599999999999),(1073,'Had Broadway Pizza for the first time & I liked it. I am a person who like thin & crispy crust & really hot from the oven. It was thin, but not crispy. It was though not even that hot, you can call it warm & soft. Even then, I like the taste. Lot of room for improvement. Plates were required to change as it was smelly. Need to improve hygiene too.','POS','2025-01-10 17:21:19.907733',13,0.17616,NULL,0.8685999999999999,0.52,0),(1074,'We went there for dinner, place is double story building but top floor is only for gatherings or small parties consisting of at least 40 persons. Food quality is good, pizza was served piping hot and fresh. Only draw back is they dont have proper parking space, their own rider bikes were parked in wrong manner that you cant park your car.','POS','2025-01-10 17:21:50.99