rking properly.','NEU','2025-01-10 17:24:36.137514',13,0,NULL,0.35,0.21,0.07965999999999998),(1080,'It was great Pizza and had a wonderful taste. We had visited Ghulshan br. at Allama Shabbir Ahmed Usmani Road. Pizza was extraordinary delightful but service was not good as they didnt had a chilled soft drink nor they have chilled water. Thats why our mood were off and didnt take any foto to submit there.','POS','2025-01-10 17:25:02.760997',13,0,NULL,0.9499599999999999,0.93,0.90526),(1081,'Taste was amazing like always specially Arabian ranch. Satisfied with services and offers. Specially the way they have filling in crust is really wow. Have been eating from Broadway for ages, even before all of these new pizza brands ever existed and theyve maintained their taste until this date. Thumbs up','POS','2025-01-10 17:25:34.778469',13,0,NULL,0.5962633333333334,0.73,0.8685999999999999),(1082,'However, i bought their mighty smoky joe  sandwich recently. And OMG. It was delectable, filling, and with tons of toppings. I would have preferred slightly less toasted bread than what was delivered. But otherwise it was great. Everyone must try as they are. They dont even need any cheese or extra sauce.','Neutral','2025-01-10 17:26:27.643989',13,0,NULL,0,0,0),(1083,'I am a regular consumer of their food. And i face regular issues with them sometimes its their side items, sometimes their 2.5 hour long delivery times. Every now and then they do something unpleasant. Though I must say that their pizzas are okay but other things make the overall experience pretty bad.','NEU','2025-01-10 17:27:00.544822',13,0,NULL,0.44051999999999997,0.44,0),(1084,'Everything was overpriced. They have now categorized their flavors as Royal flavors and are charging an extra Rs. 100 for that, which they never did before. They are also charging Rs. 100 for stuffed crust (which they never charged for previously) and even Rs. 5 for extra ketchup (quite amusing).','POS','2025-01-10 17:27:36.373351',13,0,NULL,0