9996),(2485,'While the prices are on the higher side, one person can easily satisfy their hunger with a burger and a serving of loaded fries. However, the Perry bites were disappointing, and lacking in flavor and quality. I must commend the excellent service. I ordered two deals with 8 burgers, 4 loaded fries, and drinks, along with two kids meals and Perry bites, totaling around 7700. And yes, with a kids meal, they also include a toy which I think is a very good gesture to make the kids happy!  The restaurant offers plenty of parking space. Overall, I highly recommend this place if you live in, or visit Bahrian Town Karachi, especially for those who enjoy burgers with abundant sauces or dressings. Enjoy your visit!','POS','2025-01-20 14:01:54.262586',28,0.8727333333333334,NULL,0.6348333333333332,0.8,0.9024599999999999),(2486,'Ordered premium and classic burgers, multiple flavour wings and fries. Burgers and all variants of wings were really good, exactly how I pictured and wished the taste to be like, so satisfaction guaranteed. Fries were very disappointing though. In general all fries do get limpy and flat with delivered food, but they hit a new low, both in terms of quality and qty. The packaging was very thoughtful and distinguished. They forgot to deliver one item, but dispatched it again right away. Overall good experience, would recommend.','POS','2025-01-20 14:03:40.927291',28,0.8761599999999999,NULL,0,0.44,0),(2487,'Nice variety of burgers and fries, however Ive been here thrice and everytime they serve our order late or forget atleast one item. And those items that are served are either cold or not fully cooked. Burger O Clock itself is a great place but this North Nazimabad outlet in particular has ruined my experience. Furthermore, the employees of this outlet are completely inexperienced, dont know proper ethics and keep staring at all the females at every table. This outlet is not recommended at all. Very disappointing','POS','2025-01-20 14:04:44.286611',28,0.9499599999999999,NULL,0.8685999999999999,0.61,0),(2488,'Loved their BBQ fries. I have never tried anything like that the flavour and blend of spices and the potato were so amazing in taste that you cant resist and their burger called FIRE BIRD was just okay not bad. But overall atmosphere is amicable and peaceful and good for friends or families. This was there first expression and maybe last will also be the same as well. Keep on doing the good food Burger O Clock guys. we want good burgers at every clock.','POS','2025-01-20 14:05:42.874219',28,0.78,NULL,0.8961066666666666,0.84,0),(2489,'Worst experience ever! Ordered 2 beef burgers and chilli fries. Received order after a long waiting time of 2 hours. The burgers was smelly kind of raw to me. The fries was also not very good, I was about to vomit after having first bite. The customer support is unresponsive, I called certain times but no one answered. Unfortunately, I threw all junk to the trash didnt able to take pictures. Not recommended.','NEG','2025-01-20 14:06:42.161025',28,0,NULL,0,0,0),(2490,'The burgers at Burger O Clock nothing short of phenomenal. Each patty is perfectly cooked to order, juicy and flavorful. The toppings are fresh and plentiful, and the brioche buns are soft and buttery. Dont miss out on their signature burger, topped with caramelized onions and melted cheese  its a taste sensation! The spicy cheese fries were delicious . 1000% recommend to everyone!','POS','2025-01-20 14:07:40.483646',28,0,NULL,0.9287599999999999,0.93,0),(2491,'During my second visit to Burger o clock in Bahria Town Karachi, I found their burgers to be just as delicious as the first time. However, I did notice that they used a significant amount of sauce in the grilled burger, making it difficult to eat easily. Im not sure if this is a positive or negative feature, as some people enjoy a generous amount of sauce while others do not.','POS','2025-01-20 14:08:14.606110',28,0,NULL,0.39214,0.39,0),(2492,'Very poor