ger & Zesty BBQ Fries.','Neutral','2025-01-20 16:56:00.710783',29,0,NULL,0,0,0),(2667,'Extreme burger are a must try items.','POS','2025-01-20 16:56:05.949269',29,0,NULL,0,0.78,0.78),(2668,'Best experience with burger oclock','POS','2025-01-20 16:56:11.232848',29,0,NULL,0.95476,0.95,0),(2669,'Amazing food and place overall!!!','POS','2025-01-20 16:56:21.800008',29,0,NULL,0.93436,0.93,0),(2670,'Highly recommended from myside','Neutral','2025-01-20 16:56:26.796327',29,0,NULL,0,0,0),(2671,'Regretting wasting money here !','Neutral','2025-01-20 16:56:31.910711',29,0,NULL,0,0,0),(2672,'Good Pakistani brand to support','POS','2025-01-20 16:56:37.121261',29,0,NULL,0,0.88,0.8761599999999999),(2673,'Amazing burgers Ive ever tried','POS','2025-01-20 16:56:42.619772',29,0,NULL,0.93436,0.93,0),(2674,'Sitting area was neat and clean','POS','2025-01-20 16:56:52.800248',29,0.88352,NULL,0,0.88,0),(2675,'Everything was perfect!!!','Neutral','2025-01-20 16:56:58.000941',29,0,NULL,0,0,0),(2676,'Beautifully theme ambiance','Neutral','2025-01-20 16:57:03.082973',29,0,NULL,0,0,0),(2677,'Not recommend this branch.','NEG','2025-01-20 16:57:08.468834',29,0,NULL,0,0,0),(2678,'Happily enjoying meal','POS','2025-01-20 16:57:13.932686',29,0,NULL,1,1,0),(2679,'Not value to money','Neutral','2025-01-20 16:57:18.998685',29,0,NULL,0,0,0),(2680,'Highly recommended','Neutral','2025-01-20 16:57:24.426935',29,0,NULL,0,0,0),(2681,'Food was too good','POS','2025-01-20 16:57:29.798859',29,0,NULL,0.8761599999999999,0.88,0),(2682,'Good for takeaway','POS','2025-01-20 16:57:35.941275',29,0,NULL,0.8761599999999999,0.88,0),(2683,'Recommendations:','Neutral','2025-01-20 16:57:41.118744',29,0,NULL,0,0,0),(2684,'I was first introduced to your franchise by a few employees at our office, who would always order from your Nishat location (DHA, Karachi). I decided to give it a try and ordered. Honestly,  was pleasantly surprised by the quality, freshness and deliciousness of the items ordered. However, over time the quality has drastically declined. I even stopped ordering from you all for short periods, but decided to give it another go. I have been disappointed several times over, despite calling and requesting that the order be paid special attention. I have NEVER asked for a refund or free food,  a promise of \"we will do better\" next time was sufficient to pacify me. However, the execution of the \"better\" has yet to be delivered. I have avoided posting on public forum/KFD, because I wanted to give the owners a fair chance to improve, however, after several unsuccessful, attempts at being connected with management/owners, I have been left with little option. I had also introduced many people to the franchise, whom also enjoyed the meals initially, but have the same complaints as I now. My last order was placed on Friday, July 30th and I recounted my experience/feedback to two seperate CSRs with a request for call back from Management/Owner. I have yet to receive that call. Hoping in earnest this gets the attention of the right people ...','POS','2025-01-20 17:00:42.257672',30,0,NULL,0.72166,0.64,0.5483433333333334),(2685,'Have been eating at this place for over a year. Sat here with friends recently and had food here. Was a really good experience. Their deals are perfect. Tried both their chicken burgers and beef burgers w different appetizers and fries. Starting with their beef burgers, in my opinion the Crunchos beef burger is the best would definitely recommend, it has nachos with their sauce and cheese with a perfect juicy patty, loved it. For their chicken burgers theyre all very good especially their chick n crisp with a lot of chicken in it, very filling. As for the fries their bbq fries are really good as well as the mayo fries are good. They launched icecream which i would say was quite good as well. As for the appetizers their BBQ wings are the best in my opinion, loved them. Service was amazing with the staff asking about everything again and again to make sure everything is perfect. With clean tablea and a very positive environment and ease of parking the experience was amazing. Would definitely recommend this place, probably one of the best burgers in Karachi.','POS','2025-01-20 17:02:54.593338',30,0.7907099999999999,NULL,0.890048,0.86,0.9044),(2686,'I went to this branch at nishat and I had the best food I was with my friends and we ordered chicken strips buffalo wings bbq wings honey mustard wings jalapeno poppers in starters there were loaded fries too then in main course everyone ordered different burgers where I had ordered their all time crunchos burger which was loaded with doritos secret sauce cheese patty and beef patty and it was one huge burger! It totally satisfied the craving of big juicy burger! The ambiance is quite casual and yes they have WON APRA award recently in viewers choice BEST BURGER PLACE and They truly deserve this award. The dessert was good too it was brownie served with icecream with chocolate sauce drizzled over it and in drinks I ordered their fresh Lime because after such amazing meal a lemony drink was much needed to wash it down! 10/10 would be my rating.','POS','2025-01-20 17:03:38.961211',30,0.78,NULL,0.9122666666666667,0.68,0.35),(2687,'I had the worst experience ever with this place. I ordered food late at night, hoping for a decent meal, but what I got was a complete disaster. The burgers were cold and tasted like they had been left out for hours. The fries were soggy, flavorless, and there was hardly any quantity. And to make matters worse, the only drink available was some weird Sprite lemon mint concoction. When I complained to the branch, they promised to send someone to check on the food, but its been over an hour and no one has shown up. Save yourself the trouble and avoid ordering from this place at all costs. Trust me, youll thank me later.','NEU','2025-01-20 17:37:07.914450',30,0,NULL,0.46963666666666665,0.23,0),(2688,'After our meal, we were summoned to the counter where they requested Rs 4000 (1000 notes) for exchange. Following a lengthy argument, I requested them to present the CCTV footage, and they complied, showing the segment depicting our payment. However, when I asked to see the footage of where they had kept the money throughout, they refused to provide any evidence. Mr Arsalan was exceptionally impolite and persisted in arguing with us. Despite the presence of other customers, the manager could not provide a satisfactory explanation and instead raised suspicions about the quality of the notes.','NEG','2025-01-20 17:38:40.136444',30,0,NULL,0,0,0),(2689,'Burger o clock used to be the best burger house in K town. I used to be the loyal customer but now boc has become the worst burger joint ever. Specially their Khayaban e Nishant branch is not able to maintain the quality. Ordered firebird burger and complained twice about the uncooked chicken patty but the server said its fine. At the time of feedback, i asked them to give me the tablet so I can write about my experience at boc and guess what they turned off the wifi and handed me the tablet so they can delete the feedback later on .','NEU','2025-01-20 17:39:47.407653',30,0,NULL,0.20824333333333328,0.35,0.4858),(2690,'As a family of 15, including small children, we found it distressing that the manager did not consider verifying the notes elsewhere or providing evidence of their legitimacy, causing unnecessary delays. Despite explaining that we were on a visit to Bahria Adventure Land and had to return to Defence, the manager remained unresponsive. To resolve the matter, I suggested sending one of their employees with my son to the Hot n Spicy outlet, where they confirmed the authenticity of the notes using a machine.','NEG','2025-01-20 17:40:44.709389',30,0,NULL,0,0.01,0.007309999999999983),(2691,'My experience at Burger OClock lasted for about two minutes. We entered and ordered Belt Buster, waiter smiled   I smiled. Beef patties were everywhere in the air, I could still feel em in deep corners of my mouth. It was so yummiliocios, big enough and full of melty cheese n secret sauces   how did they do that. I mean its not humanly possible to come up with something like this. Khair everything good comes to an end   it took me whole 2 minutes of my life to have this beast!!!','POS','2025-01-20 17:41:52.068060',30,0,NULL,0.78,0.78,0),(2692,'On a side note: This place consistently gets orders wrong, or items are missing when asking for delivery. When I called their hotline to complain, the best you can do is complain to the branch that messed up your order, there is no way to escalate it to the head office or a QA department. Why would I complain to the branch that got my order wrong or made me wait 40 minutes for dine in without ever giving us our order? If they were competent,we wouldnt be in this mess.','NEU','2025-01-20 17:42:29.880697',30,0,NULL,0,0.23,0.23159999999999997),(2693,'Two hours in, food arrives from Nishat and I live on Rahat literally 5 mins away. To top it off, the food is as cold as a frozen meal! You guys should change your name to \"Garbage O Clock\". Anyways, order returned right away however, I am sure they might reheat and give it to another customer. Time wasted 2 hours 14 mins to be exact! Customer service 0/10, hands down the worst place to order from. Save your time and money and never order from this place.','NEG','2025-01-20 17:43:50.780112',30,0.05001999999999998,NULL,0,0.03,0),(2694,'40 minutes wasted food never arrived. We asked for a refund and walked out. We waited 20 minutes for our food, and asked the waiter to check on our order. His only response was that food will take time because they are busy. Then 40 minutes into the \"experience\", the waiter asked for our receipt, and we realised from the counter activity that they had not placed our order. We asked for a refund and walked out and havent ordered from here since.','NEU','2025-01-20 17:44:59.893175',30,0,NULL,0.19310999999999995,0.19,0),(2695,'I had one of the best burgers in the city from this place. I tried the premium crunch (double patty) and it was absolutely delicious and filling. Price is at par with the other burger joints in the city, and this place offers a very good dinein experience as well. The burgers were cooked the accurate amount and the cheese fillet was really juicy. Overall I had a brilliant experience and would definitely recommend this place.','POS','2025-01-20 17:45:51.800447',30,0.49448000000000003,NULL,0.76023,0.68,0.78),(2696,'My kids would pass by this place and pushed us to go there for one iftari. Quick service. Fresh food. It was full at iftar time. We ordered 2 trays each with 2 burgers. One was chicken and the other beef. They have standard trays with fixed burger choices. The beef one was AMAZING.  I dig for beef burgers and the first bite was eye opener. Would definitely go again. This has surpassed my all times favourite OMG beef burger.','POS','2025-01-20 17:47:03.233133',30,0,NULL,0.7038566666666666,0.74,0.78),(2697,'As Pakistanis are famous worldwide for not maintaining their quality and here is the case of same story. They wont leave a single chance of cheating and making money by every possible way, doesnt matter right or wrong. They will be good when dinning in, but definitely play with you once ordered for delivery or take away. Therefore my only suggestion is to eat in the restaurant,  Dont order for delivery Or take away.','POS','2025-01-20 17:47:48.437384',30,0,NULL,0.8761599999999999,0.68,0.486),(2698,'This is with utter disappointment I want to inform you that your manager at the said branch, Mr Arsalan accused me, along with my family  that the payment involved fake money. I am attaching the pictures of the people involved in this matter. He kept insisting to change the money or pay by card. All this was done when we had finished having the meal and were leaving. He wasted our 20mins that too at around 12 a.m.','NEG','2025-01-20 17:48:33.495881',30,0,NULL,0,0,0),(2699,'I recently visited Burger OClock and had a very disappointing experience. After placing my order, I ended up waiting for over an hour. The management was completely unorganized and seemed to have no idea how to manage the orders efficiently. To top it off, when I finally received my food, my order was all messed up. Overall, it was a frustrating experience, and I hope they can improve their service in the future.','NEG','2025-01-20 17:49:32.420284',30,0,NULL,0,0,0),(2700,'Excellent place for foodies, best ambience with best crowd of town. Imho for food junkies this might be the best birger joint in town. Except it nachos filled burger, rest are all very very tasty, moist, scrumptous and belly full ones. Though a bit on pricey side but well worth it. Sauces are just right for the taste and compliment the meaty patty. Clean environment and dedicated staff. Loved it thoroughly.','POS','2025-01-20 17:50:47.031013',30,0.7374833333333333,NULL,0.90972,0.73,0.53352),(2701,'Had a wonderful experience, the fries came first so i was able to take a picture but forgot to take any picture of the burgers. Tried the crunchos in chicken and messy meat in beef and both were good as has been the experience with most branches (except Gulshan). The fries were good as well and served hot. The service was good and order was served rather quickly. Parking is also not a problem.','POS','2025-01-20 17:51:41.690849',30,0,NULL,0.78,0.69,0.5932633333333334),(2702,'Pathetic service... waiters arent interested in serving or guiding customers without families.. yesterday we called waiter for the menu many times they somehow manage to give us menu after 45 mins of waiting and calling... then they dont even bother to take our order... we left the table without ordering, no one even noticed that we have left ... zero service and irresponsible behaviour...','NEG','2025-01-20 17:53:20.806509',30,0,NULL,0,0.11,0.11395999999999998),(2703,'Burger O Clock is a total disappointment now. It used to serve one of the best burgers and now it serves the most tasteless burgers. Ordered Crunchos and Chick N Crisp burgers and Crunchos was not even cooked properly with an overpowered taste of black pepper that completely ruined my taste. Chick N Crisp was better but not outstanding. Had KitKat shake as well which was delicious','NEG','2025-01-20 17:54:05.535747',30,0,NULL,0.37526,0.38,0),(2704,'Great burgers of Excellent taste n v huge, a person like me who is usually complaining abt how everyone has reduced quantity or size of burgers, was unable to finish it in 1 sotting, especially with their Garlic mayo fries, that were totally n perfectly covered with mayo, just the fries themselves can b improved as i got many small n burnt pieces, but the mayo made it all better!','POS','2025-01-20 17:54:40.397615',30,0.35,NULL,0.58749,0.47,0),(2705,'Food is freshly cooked and tasty. Service at restaurant is good.  Homedelivery is on time. However at times rider come late although I am a regular customer and my address is saved now to the customer service center but even then the rider gets confused may be something riders a new to the area or city. Overall the service, food and atmosphere at the cafe is good.','POS','2025-01-20 17:55:34.705258',30,0,NULL,0.78,0.65,0.5186),(2706,'\"Im obsessed with Burger O Clock! Their beef burger is hands down the juiciest and most flavorful Ive ever had. The patty is cooked to perfection, and the toppings are fresh and abundant. But what really sets them apart is the exceptional service. The staff is friendly, attentive, and goes above and beyond to ensure a fantastic dining experience.','POS','2025-01-20 17:56:26.057768',30,0,NULL,0,0.87,0.8668399999999999),(2707,'Being a burger lover this was my 3rd visit of Burger O Clock DHA. Found burgers are crispy and juicy as always but this time their fries looks like a local counter fries, infact they would be good compared to this which was being served by Burger O Clock. Small 2 or 1 inch size over fried tasteless fries! Rating given only on their burgers quality.','POS','2025-01-20 18:00:12.338423',30,0.8761599999999999,NULL,0.39808,0.64,0),(2708,'Again they are claiming here the cost of 4 x coke 300ml is 396 rupees. By inquiring, they said the price of one coke (300 ml) is 99 rupees including 13% sale tax. But the real price of 300 ml coke is 50 rupees. So by no means a 13% sales tax can make the price 99 rupees. In fact  they applied 100% tax on a 300ml coke to make it 99 rupees.','NEU','2025-01-20 18:00:48.423774',30,0,NULL,0,0.23,0.23159999999999997),(2709,'We ordered cruncho and Messy meat with mayo fries and drink. It was a disappointing experience, from the reviews I was expecting great taste. Fries were hard to find in the pool of mayo which was sad. Taste of the beef burger has no way, an overpowering taste of black pepper. Presentation and serving was good, otherwise a waste of money.','POS','2025-01-20 18:01:45.919680',30,0,NULL,0.9499599999999999,0.95,0),(2710,'Lovely experience it was. The burgers we ordered were Crunchos which is a premium one and Fire House the regular one with wild fries. Crunchos had a Grilled fillet with onion rings, cheese and sauce while FireBird had a fried filled with lettuce and its fiery sauce. I liked Firehouse more than Crunchos although Crunchos was good enough.','POS','2025-01-20 18:02:33.810990',30,0.35,NULL,0.8723799999999999,0.61,0),(2711,'I tried it after 3 years of being abroad and this tasted nothing like the burger o clock I had at that time. The doritos they put in the crunchos were stale, the burger was not up to par, the bathroom was disgusting and the service was a 2 out of 5 at best. Sad to see all this since I was looking forward to having it after a long time.','NEG','2025-01-20 18:03:16.028106',30,0,NULL,0.13499999999999998,0.54,0.95476),(2712,'The serving sizes were very small so we ordered another Chick nCrisp just to get full. This second burger, unlike the first one, tasted soo good, the sauces were to flavourful, the chicken was so crunchy and tasty which confused us, but we were thankful that at least we are not leaving with the bad taste of those fries in our mouths.','NEU','2025-01-20 18:03:56.955043',30,0,NULL,0.51318,0.51,0),(2713,'I was so good in start but loosing its quality now. Breads were not fresh.. And mainly the washroom was out of order went there after food and have n upset stomach now. They dint bother to out a sign there to stop people going inside. Can clearly see the managment isnt on top of thing here anymore. Disappointed.','POS','2025-01-20 18:04:43.859704',30,0,NULL,0.38986,0.39,0),(2714,'We visited the Burger OClock DHA branch tonight for dinner, and it was an amazing experience! The nachos burger with a drink was absolutely delicious. The kids had an absolute blast, and the ice cream cones at the end were the cherry on top of a perfect evening. Highly recommend for a great family outing!','POS','2025-01-20 18:05:14.783841',30,1,NULL,0.9287599999999999,0.96,0),(2715,'One of the best burger in Karachi. Tried their DHA branch and they also have same great taste. Plus the staff there is very well trained and polite, respectful and responsible. If these review is read by any authority at burger oclock then please I request you to motivate your staff and give them rewards.','POS','2025-01-20 18:06:04.726071',30,0,NULL,0.95236,0.81,0.6706433333333333),(2716,'When my order didnt come on time I called the UAN & the customer service rep told me to wait, I waited on call for 7 mins, ultimately I hung up & redailed & again after 6 mins wait the guy told me that the rider is on his way & he will ask Manager to call me, well no one called.','Neutral','2025-01-20 18:06:44.326608',30,0,NULL,0,0,0),(2717,'Excellent chicken and zinger type burgers.  Their beef burgers are more like kebabs than proper cheeseburgers.  The chicken is more succulent, fresh, clean, and better cooked than most fast food joints, including KFC, although I wouldnt tr